    [self readAll:YES];
    NSUInteger value = 0;

    return value
    ^
    [self->_address hash]
    ^
    [self->_place hash]
    ^
    (self->_flags.has_type ? PBHashInt((NSUInteger)self->_type) : 0)
    ^
    [self->_personalizedMaps hash]
    ^
    [self->_placeRequest hash]
    ;
}

- (void)mergeFrom:(GEORPAddressFeedback *)other
{
    [other readAll:NO];
    if (self->_address && other->_address)
    {
        [self->_address mergeFrom:other->_address];
    }
    else if (!self->_address && other->_address)
    {
        [self setAddress:other->_address];
    }
    if (self->_place && other->_place)
    {
        [self->_place mergeFrom:other->_place];
    }
    else if (!self->_place && other->_place)
    {
        [self setPlace:other->_place];
    }
    if (other->_flags.has_type)
    {
        self->_type = other->_type;
        self->_flags.has_type = 1;
    }
    if (self->_personalizedMaps && other->_personalizedMaps)
    {
        [self->_personalizedMaps mergeFrom:other->_personalizedMaps];
    }
    else if (!self->_personalizedMaps && other->_personalizedMaps)
    {
        [self setPersonalizedMaps:other->_personalizedMaps];
    }
    if (self->_placeRequest && other->_placeRequest)
    {
        [self->_placeRequest mergeFrom:other->_placeRequest];
    }
    else if (!self->_placeRequest && other->_placeRequest)
    {
        [self setPlaceRequest:other->_placeRequest];
    }
}

- (PBUnknownFields *)unknownFields
{
    if (_flags.read_unknownFields) return _unknownFields;
    os_unfair_lock_lock_with_options(&_readerLock, OS_UNFAIR_LOCK_DATA_SYNCHRONIZATION);
    PBDataReader *reader = _reader;
    os_unfair_lock_unlock(&_readerLock);
    if (!reader) return _unknownFields;
    @synchronized(reader) {
        if (!_flags.read_unknownFields) {
            static const uint32_t tags[] = {TAG_UNKNOWN_FIELDS, 0};
            GEORPAddressFeedbackReadSpecified(self, reader, tags);
        }
    }
    return _unknownFields;
}
- (void)clearUnknownFields:(BOOL)recursively
{
    _flags.read_unknownFields = 1;
    _flags.wrote_unknownFields = 1;
    _unknownFields = nil;
    if (!recursively) {
        return;
    }
    [self readAll:NO];
    [_address clearUnknownFields:YES];
    [_place clearUnknownFields:YES];
    [_personalizedMaps clearUnknownFields:YES];
    [_placeRequest clearUnknownFields:YES];
}

@end


